import React from 'react';
import '../styles/Hockey.css';

const Volleyball = () => {
  return (
    <div className="hockey-container">
    <h1>VOLLEYBALL</h1>
      <h2>Welcome to Volleyball at Kilifi Sports Hub!</h2>
      <p>Volleyball is a popular sport at Kilifi Sports Hub, drawing players and enthusiasts from the local community. The hub boasts well-maintained courts and facilities for volleyball training and competitions.</p>
      <p>Teams at Kilifi Sports Hub participate in regional tournaments and friendly matches, showcasing their skills and teamwork on the court. Experienced coaches work with players to improve their technique and strategy, ensuring a competitive edge in every game.</p>
    </div>
  );
}

export default Volleyball;
